import React from 'react';
import PropTypes from 'prop-types';
// import Dummy from '../ui/dummys/Dummy';
import Button from 'ui/buttons/Button';
import SelectMonth from 'ui/form/SelectMonth';
import SelectYear from 'ui/form/SelectYear';
import SVGPrevious from 'ui/svg/Previous';
import SVGNext from 'ui/svg/Next';
import styles from './calendar.scss';
import DaysOfWeek from 'ui/daysOfWeek/DaysOfWeek';


/**
 * General component description in JSDoc format. Markdown is *supported*.
 */

var test =  '';

console.log( test );

const Calendar = ( option ) => (
    <div>
        Calendar
        <div>
            <Button text="Month"  />
            <Button text="Week" />
            <Button text="Day" />
        </div>
        <SelectMonth
            option input="January"
            option input="February"
            option input="March"

        />
        <SelectYear />

        <SVGPrevious width={20} height={10}/>
        <Button text="Previous"/>
        <Button text="Next" />
        <SVGNext  width={20} height={10}/>
        <DaysOfWeek />

    </div>


);


Calendar.propTypes = {
    /** Description of prop "text". */
    text: PropTypes.string,
    optionsState: PropTypes.string


};

Calendar.defaultProps = {
    text: 'defaultText'


};

export default Calendar;
